import { PropsWithChildren } from "react";

type Props =  {
    handleClick : ()=>void
}

const Button = ({ handleClick, children } : PropsWithChildren<Props> ) => {

    return (
        <button onClick={handleClick}>
          {children}
        </button>
      )
};

export default Button;
